import React, { useState } from "react";
import { Form, Input } from "antd-mobile";
import { StyleSheet } from "react-native";

const Withdraw = () => {
  return (
    <Form layout="horizontal">
      <Form.Item
        extra={
          <div>
            <a>PASTE</a>
          </div>
        }
      >
        <Input placeholder="Recipient Address" clearable />
      </Form.Item>
    </Form>
  );
};

export default Withdraw;
